import { iUser } from "./interfaces/users";

export const NutritionCard = ({ userData }: { userData: iUser }) => {
  return (
    <main>
      <section>
        <div>
          <h2>Nutrition Information</h2>
          <p>Calorie Count: {userData.keyData.calorieCount}</p>
        </div>
      </section>
    </main>
  );
};
